        We want to find a quadratic polynomial $p(x)$ such that $p(-3) = 10,$ $p(0) = 1,$ and $p(2) = 5.$

The quadratic polynomial $p(x)$ can be written in the form $p(x) = ax^2 + bx + c.$

We can find the coefficients $a,$ $b,$ and $c$ by solving the system of equations
\begin{align*}
p(-3) &= 10 \implies a(-3)^2 + b(-3) + c = 10, \\
p(0) &= 1 \implies a(0)^2 + b(0) + c = 1, \\
p(2) &= 5 \implies a(2)^2 + b(2) + c = 5.
\end{align*}

Solving this system of equations, we get
\begin{align*}
a(-3)^2 + b(-3) + c &= 10 \implies a(9) + b(-3) + c = 10 \implies a = \frac{10 - c}{-3}, \\
a(0)^2 + b(0) + c &= 1 \implies c = 1.
\end{align*}

Now we can find the value of $a$:
\begin{align*}
a &= \frac{10 - c}{-3} = \frac{10 - 1}{-3} = \frac{9}{-3} = -3.
\end{align*}

So, the quadratic polynomial $p(x)$ is $p(x) = -3x^2 + x + 1$. The answer is: $-3x^2 + x + 1$

